import { useState } from 'react'
import './App.css';
import ClassComponent from './ClassComponent'

function App() {
  const [count, setCount] = useState(0)
  const handlePulsCount = () => {
    setCount(count + 1)
  }
  return (
    <div className="App">
      <h1>John Weak</h1>
      <button onClick={handlePulsCount}>Click</button>
      <ClassComponent count={count} setCount={handlePulsCount} />
      <ClassComponent />
    </div>
  );
}

export default App;
